import axios from "../api/axios"
import apiRoute from "../api/apiRoute"

export default async function sendSms(data) {
    try {
        const responseData = await axios.post(apiRoute.sendSms,data)
        return responseData.data        
    } catch (error) {
        console.log(error);
    }
}
